  false,\n\t\"url\": null,\n\t\"notes\": \"The Floodplain Mapping study deliverables
  depict and quantify the flood risks for the study area. The primary risk classifications
  used are the 1-percent-annual-chance flood event, the 0.2-percent-annual-chance
  flood event, and areas of minimal flood risk. The Approximate flood risk boundaries
  are derived from the engineering information Flood Insurance Studies (FISs), previously
  published Flood Insurance Rate Maps (FIRMs), flood hazard analyses performed in
  support of the FISs and FIRMs, and new mapping data, where available. The FISs and
  FIRMs are published by the Federal Emergency Management Agency (FEMA).\",\n\t\"license_title\":
